import './App.css';
import { Route, Routes, Router } from 'react-router-dom';
import Navbar from './components/sitegeneral/Navbar';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/showsearch/*' element={<ShowSearcherApp />} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
